(1, 'Hidden Message', '<p>\r\n	Download: <a href=\"http://54.175.77.52/crypto/crypto1_243c6e8f6277cef809d5e16c8ba2193fc97f5d56.zip\">crypto1_243c6e8f6277cef809d5e16c8ba2193fc97f5d56.zip</a></p>\r\n<p>\r\n	Cờ lu&ocirc;n c&oacute; định dạng SVATTT2017{flag}, nếu kh&ocirc;ng c&oacute; định dạng n&agrave;y, bạn cần th&ecirc;m cho đủ.</p>\r\n', 'YiXFl4NQX01E6lX4GyD0EOMYWdK2T5Sf2g//MCHlnd1QAkrO/nSQtrzgFCxnYSA2ngCW5hGl3z3Nvk95womvpt/5AWQ3TIheK/XTzSCQjFoNIq68n8H+gcDpNf7eIwSv', 100, 1, 1),
(2, 'Genie', '<p>\r\n	nc 52.55.92.145 22995</p>\r\n<p>\r\n	Download: <a href=\"http://54.175.77.52/crypto/crypto2_14e6fb24676711209220b3169ffe742ca1f87e7e.zip\">crypto2_14e6fb24676711209220b3169ffe742ca1f87e7e.zip</a></p>\r\n<p>\r\n	Cờ lu&ocirc;n c&oacute; định dạng SVATTT2017{flag}, nếu kh&ocirc;ng c&oacute; định dạng n&agrave;y, bạn cần th&ecirc;m cho đủ.</p>\r\n', 'SxC+abQ+2gq5yCgjn0Gl19Y3dytOwsc7vEGjdvlX0wbjGa4fMRYUsdZgAUeLj+fdfB9VSfGquQ9dP3uYeLWGEwWvMQtaQSJOeconJt6K6m7Uv2wgDVZ2OSwipYnDBftl', 100, 1, 1),
(3, 'Secret service', '<p>\r\n	nc 54.158.49.56 11337</p>\r\n<p>\r\n	hoặc</p>\r\n<p>\r\n	nc 13.229.117.87 11337</p>\r\n<p>\r\n	Download: <a href=\"http://54.175.77.52/crypto/crypto3_c5ff95cf07208f1a171952cdc7bd919bedcf4351.zip\">crypto3_c5ff95cf07208f1a171952cdc7bd919bedcf4351.zip</a></p>\r\n<p>\r\n	Cờ lu&ocirc;n c&oacute; định dạng SVATTT2017{flag}, nếu kh&ocirc;ng c&oacute; định dạng n&agrave;y, bạn cần th&ecirc;m cho đủ.</p>\r\n', 'M5T0dhdpaDi8uUKZWROT1zthFb1NxfPnIOBtTFnT/Vr63IPxd9cQ5l+70CM193RK6Ax5VYiI4f+o6s1L4YEVzg==', 300, 1, 1),
(4, 'Sad Book', '<div>\r\n	Sự ph&aacute;t triển của c&ocirc;ng nghệ đ&atilde; thay đổi mọi thứ. Anh ấy y&ecirc;u c&ocirc;, nhưng lại kh&ocirc;ng d&aacute;m n&oacute;i ra, chỉ biết ng&agrave;y ng&agrave;y đắm ch&igrave;m trong thế giới của ri&ecirc;ng m&igrave;nh. C&ocirc; muốn gi&uacute;p anh, nhưng gi&uacute;p l&agrave;m sao đ&acirc;y khi ch&iacute;nh c&ocirc; cũng kh&ocirc;ng hiểu r&otilde; những g&igrave; anh đang nghĩ...</div>\r\n<div>\r\n	Người ta đồn bạn l&agrave; một hacker, bạn c&oacute; thể x&acirc;m nhập v&agrave;o mọi hệ thống, bạn lấy tiền của người gi&agrave;u v&agrave; cũng lấy lu&ocirc;n của người ngh&egrave;o, chẳng chia cho ai cả. T&ocirc;i cho bạn một cơ hội để thay đổi định kiến đ&oacute;: H&atilde;y t&igrave;m hiểu về nội t&acirc;m của anh, h&atilde;y gi&uacute;p anh tho&aacute;t ra khỏi đau khổ của ch&iacute;nh m&igrave;nh, h&atilde;y gi&uacute;p họ đến với nhau...</div>\r\n<div>\r\n	T&ocirc;i nghĩ bạn đ&atilde; biết rồi, nhưng nếu chưa, th&igrave; anh ấy l&agrave; admin của website <a href=\"http://sadbook.svattt2017.ns01.info\">http://sadbook.svattt2017.ns01.info</a>, hội những người tự kỷ v&agrave; kh&ocirc;ng bao giờ c&oacute; người y&ecirc;u (ai lại th&iacute;ch một người tự kỷ?). Hoặc l&agrave; bạn nhanh l&ecirc;n, hoặc l&agrave; c&aacute;i hội đ&oacute; sẽ quay sang y&ecirc;u lẫn nhau, t&ocirc;i đang ho&agrave;n to&agrave;n nghi&ecirc;m t&uacute;c!</div>\r\n', 'sP0okVuN8FZVNxe4vSZY4I4bB9942lDAY6U7FYlYy+ZDpk49EzyFcrryF2UFkKZ1L0+giDzPbB9Wnb1zfmoptIco4kkT6isuVbOE61YsU1MR17iTdfGkNHWQPdcFlq4M', 300, 1, 2),
(5, 'Hidden', '<p>\r\n	Cuộc sống quả thật k&igrave; diệu, c&ocirc; g&aacute;i trong &quot;Sad Book&quot; đ&atilde; c&oacute; thể gần anh hơn một ch&uacute;t nữa. Nhưng trong nội t&acirc;m của anh, trong s&acirc;u thẳm tiềm thức của anh vẫn ẩn chứa nhiều b&iacute; mật. Những b&iacute; mật đ&oacute; được anh giấu k&iacute;n, c&ocirc; kh&ocirc;ng thể t&igrave;m ra. Đơn giản, &quot;chỉ l&agrave; anh giấu đi&quot;, như một ca kh&uacute;c m&agrave; c&ocirc; v&agrave; anh đều thuộc.</p>\r\n<p>\r\n	<br />\r\n	Bạn chắc chắn kh&ocirc;ng đ&agrave;nh l&ograve;ng để người con g&aacute;i đ&oacute; tiếp tục đau khổ, bạn thật sự vẫn đang dằn vặt bản th&acirc;n v&igrave; đ&atilde; chưa gi&uacute;p hết sức m&igrave;nh. Đừng lo, t&ocirc;i cho bạn một cơ hội thứ hai để gi&uacute;p c&ocirc; g&aacute;i đ&oacute;, cũng l&agrave; một cơ hội để bạn giải tho&aacute;t khỏi t&acirc;m trạng đang giằng x&eacute; của m&igrave;nh</p>\r\n<p>\r\n	Anh kia đ&atilde; giấu một th&ocirc;ng điệp trong bức ảnh n&agrave;y bằng một chương tr&igrave;nh đặc biệt, t&ocirc;i đ&atilde; lấy được chương tr&igrave;nh đ&oacute;, nhiệm vụ của bạn l&agrave; t&igrave;m ra th&ocirc;ng điệp bị ẩn.</p>\r\n<p>\r\n	Đ&acirc;y l&agrave; chương tr&igrave;nh: <a href=\"http://54.175.77.52/binary/hidden.exe_88B5131182E5A600D13BA200F3030712822AF137\">hidden.exe</a></p>\r\n<p>\r\n	Đ&acirc;y l&agrave; bức ảnh: <a href=\"http://54.175.77.52/binary/hidden.bmp_82d688542687910eabafcf0b131be032\">Image</a></p>\r\n<p>\r\n	Cờ lu&ocirc;n c&oacute; định dạng SVATTT2017{flag}, nếu kh&ocirc;ng c&oacute; định dạng n&agrave;y, bạn cần th&ecirc;m cho đủ</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n', 'NJUNCIFGwIgRtUf60gH49ASdnSqhhNxatoB67uHItq2GGolYwD9229vSRvUrfCtc7gq3P2lQOCc6PIthb+kWOwK240+OJ/f4Z7BRMh0heCR5F6x15NIZ+f6LXxUWulia', 200, 1, 3),
(6, 'Tiêu Phong', '<p>\r\n	Link: http://54.221.119.174</p>\r\n<p>\r\n	Nhớ rằng định dạng flag lu&ocirc;n l&agrave;: SVATTT2017{xxxxxx}<br />\r\n	D&ugrave; thấy bất k&igrave; c&aacute;i g&igrave; kh&aacute;c cũng kh&ocirc;ng n&ecirc;n submit. Đừng để số phận đ&aacute;nh lừa ch&uacute;ng ta H&igrave; H&igrave;.</p>\r\n', 'Qt75YVYR2cdcMYNUEPGiqZu/9S6TK/KiTVLPA1F4YvGXrfy0scd/KKWZXgOq/IvFuV6l12xbCNHZa4VNQKlyQg==', 100, 1, 2),
(7, 'Whichgirls', '<p>\r\n	Link: http://54.243.9.12</p>\r\n<p>\r\n	Định dạng flag: SVATTT2017{xxxxxx}</p>\r\n', 'muwIt2v8f9lBQxRoeez0Vmr42OvYOeeJShlFilOpCWCLQrz4VsphoXLch3CyKcJKyWj2mtXYJL6dL21PBUraEg==', 300, 1, 2),
(8, 'Tiền tỷ', '<p>\r\n	Bạn cần 1 chuỗi ph&ugrave; hợp để qua được thử th&aacute;ch n&agrave;y. V&agrave; chuỗi đ&oacute; l&agrave; flag</p>\r\n<p>\r\n	<a href=\"http://54.175.77.52/binary/jharmony.exe_F640FE71C6CB6169DD26E6ED0B7BD1C4A4154BDD\">BInary : jharmony</a></p>\r\n<p>\r\n	Cờ lu&ocirc;n c&oacute; định dạng SVATTT2017{flag}, nếu kh&ocirc;ng c&oacute; định dạng n&agrave;y, bạn cần th&ecirc;m cho đủ</p>\r\n', 'Pi4DWGaKiOldZnLeOIq8cQh5E9iEhh+bGOYRSj7hKHyih1K0hSGn2pGq5NtXb3KLwuXfV+HQS5ZrAU/JUL9OqkBaOziuhesDSq/dU6dn2BuQxR0XFYwuINLgN+OAaIJG', 100, 1, 3),
(9, 'Serial me', '<p>\r\n	Ch&uacute;ng t&ocirc;i đang triển khai một dịch vụ serial online tại địa chỉ</p>\r\n<p>\r\n	nc 54.175.77.52 2345</p>\r\n<p>\r\n	Binary: <a href=\"http://54.175.77.52/binary/SerialMe.exe_B5D0F5F0D6854DDAAFB9128C9C39F3463D5CD8D5\">SerialMe</a></p>\r\n<p>\r\n	Cờ lu&ocirc;n c&oacute; định dạng SVATTT2017{flag}, nếu kh&ocirc;ng c&oacute; định dạng n&agrave;y, bạn cần th&ecirc;m cho đủ</p>\r\n', 'BwgWsn7rhdBXyEgwD7kQTdhtmE0U2+UnMS5R3JYZZ96q//IfQyxTlajjfyWS22L+hb/7iczAKNNMIxIcfcfBuCglwuqmpmtD9EYUU+Lf4s8PEfwLsR68DVy7B5OFnJGs', 300, 1, 3),
(10, 'nokiacum', '<p>\r\n	Trong nội t&acirc;m của ch&agrave;ng trai c&oacute; lẽ chứa nhiều hơn lời n&oacute;i. C&ocirc; t&igrave;m thấy một chiếc điện thoại của anh, trong danh bạ c&oacute; một nh&acirc;n vật b&iacute; ẩn mang mật danh X. C&ocirc; muốn xem X l&agrave; ai nhưng kh&ocirc;ng c&oacute; c&aacute;ch n&agrave;o biết được. Anh c&ograve;n c&oacute; rất nhiều chiếc điện thoại như thế. Bạn cần gi&uacute;p c&ocirc; g&aacute;i một lần nữa, để t&igrave;m ra b&iacute; mật giữa anh v&agrave; X.</p>\r\n<p>\r\n	<span style=\"font-size: medium;\">nc&nbsp;54.173.37.219 1337</span></p>\r\n<p>\r\n	V&iacute; dụ, c&aacute;ch lấy binary của điện thoại version 69.123456:&nbsp;echo 123456 |&nbsp; nc&nbsp;54.173.37.219 80</p>\r\n<p>\r\n	Để tr&aacute;nh bị ph&aacute;t hiện, bạn chỉ được kết nối 05 kết nối tới server.</p>\r\n<p>\r\n	Cờ lu&ocirc;n c&oacute; định dạng SVATTT2017{flag}, nếu kh&ocirc;ng c&oacute; định dạng n&agrave;y, bạn cần th&ecirc;m cho đủ</p>\r\n', 'luzBUM93Oql7x1EolKB7hAI3l5T2VnN5o65qbatheITghQWAVSjC7CrpGVf//c6m2V8UFY2AVqJt3K03IzTAnCsSN/w+iRfBSAwhuob4QcG32XWod5jEOFO1K6QUMb6y/nuOQuKS/QdFoIlBo7xPbUJ/717nRfXvTujnKE5NqkE=', 400, 1, 4),
(11, 'Remember me?', '<p>\r\n	http://184.73.142.41:8080</p>\r\n', '97go3m9hKk01FftOmNeg1/Optr91u637uslxyxJDKi3FXqY/BY9LzNgOO3Lil1Qv3yhiD1sPuDkTgswo+lVUkzO9OSn4J2qJn6QcIEJOU7lATZxdra8pE7X/Z4m4rroA', 200, 1, 2),
(12, 'Sniffer', '<p>\r\n	C&oacute; g&igrave; đặc biệt trong <a href=\"http://54.175.77.52/for/sniff.pcap_89f186dbcf9a2c9040d2ae6871bb72e30bb88d5b\">dữ liệu</a> n&agrave;y?</p>\r\n', 'Hw5UAUBmP+5BlkJN5TU9Awr4fQgwL/y+HbcEUsG1GXKdnNP49dbyhqfGZDAgazSBxl0pS49LNnpc6OjhulPliRFv36YAJC2DECxwkU/NUqHFgldrMxQrflT2rfQjvoL2', 100, 1, 5),
(13, 'Exploit1', '<div class=\"_3058 _ui9 _hh7 _s1- _52mr _3oh-\" data-hover=\"tooltip\" data-tooltip-content=\"8:48\" data-tooltip-position=\"left\" id=\"js_4t4\">\r\n	<div class=\"_aok\">\r\n		&nbsp;</div>\r\n	<div class=\"_aok\">\r\n		<span class=\"_mh6 _wsc\" id=\"cch_f1ab6f9daa2e452\"><span class=\"_3oh- _58nk\">nc 34.201.60.0 1337</span></span></div>\r\n</div>\r\n<p>\r\n	http://54.175.77.52/binary/pwn1_4bee342a05a1242e9aceaca77417d2ac<br />\r\n	http://54.175.77.52/binary/libc.so.6_6e0054153fffb92f56e193391416fbf5</p>\r\n', 'OPtDBBbSF2TypMcEhKAyFP5J/kGk4deJQYTiZfJEq0HWyQKmw5K5SgIRwSqMetGiL+OxjtNX4qAMRKfcLE0BYg==', 100, 1, 4);
